import React from 'react';
import Card from './Card';

const CardList = ({robots})=>{
    // const cardComp = ()=>{
    //     var arr = [];
    //     for(var i=0; i<10; i++){
    //         arr.push(<Card key={i} id={robots[i].id} name={robots[i].name} email={robots[i].email} />);
    //     }
    //     return arr;
    // }
    return(
        <div>
            {
                robots.map((user, i) => {
                return (
                    <Card
                        key={i}
                        id={robots[i].id}
                        name={robots[i].name}
                        email={robots[i].email}
                    />
                    );
                })
            }
        </div>
    );
}

export default CardList;
